import com.vordel.kps.impl.KPS;
def invoke(msg){
try{      
def userTable = KPS.getInstance().getModel().getAliases().get("subscribe");
def key = msg.get("subscriptionkey");
def updatelist = '';
def servicename = msg.get("service");
def ipRow = userTable.getCached(servicename);
def sublist = ipRow.get("subscriptionKey");
for (int i=0;i<sublist.size();i++)
	{
		if(sublist[i] == key){
			continue;
		}
		else{
			updatelist = updatelist+','+'"'+sublist[i]+'"';
		}
	}
updatelist = updatelist.replaceAll(/^,|,$/,'');
msg.put("value",updatelist);
return true; 
}catch(e){
	msg.put("scripterror",e);
	return false;
}
}

