function invoke(msg)         {            
try{
	var subs = '';
	var arr = '0123456789abcdefghijklmnopqrstuvwxyzABCDEFGHIJKLMNOPQRSTUVWXYZ'
	for (var i = 20; i > 0; i--) { 
                subs +=  arr[Math.floor(Math.random() * arr.length)]; 
     }
msg.put("subscriptionkey",subs.toString());
return true;   
}catch(e){
	return false;
}     
}

