import groovy.json.* ;
import groovy.json.JsonSlurper;
def invoke(msg)        
 {
def jsonStr=msg.get("jsonStr");
def slurperResponse = new JsonSlurper().parseText(jsonStr);
def nameandService= slurperResponse.username_servicename;
def n=nameandService.size();
def partnerName=new String[n];
def serviceName=new String[n];
for(int i=0;i<n;i++){
    def breakpoint=nameandService[i].indexOf('_');
    partnerName[i]=nameandService[i].substring(0,breakpoint);
    serviceName[i]=nameandService[i].substring(breakpoint+1);
}

slurperResponse.each(){
    dataSet-> dataSet << [PartnerName: ""]}
    
slurperResponse.each(){
    dataSet-> dataSet << [TopicName: ""]}
    
slurperResponse.each(){ 
    dataSet ->dataSet.remove('subscriptionkey')
}
slurperResponse.each(){ 
    dataSet ->dataSet.remove('username_servicename')
}

for(int i=0;i<n;i++){
    slurperResponse[i].PartnerName=partnerName[i];
    slurperResponse[i].TopicName=serviceName[i];
}
msg.put("newBody",JsonOutput.toJson(slurperResponse));
return true;        
}
